@hikewithpk and I were researching places to go for sunset in Jaipur, and these walls had the most amazing potential. We were looking at photos on Google, and this angle kept popping up, but due to the length and size of the walls, it was hard to tell where exactly the photo was taken! 

Luckily with some hiking and planning, we figured it out, and came away with some awesome photos!

